import React  from "react"

const Table = (props) => (
    <div>
        <table>
            <tr>
            <th># </th>
            {
                Object.keys(props.details).map(
                    (values, _) => <th> {values, v}</th>
                )
            }
            </tr>
        </table>
    </div>
)


export default Table;
